def convertToDouble(input: Any): Double = {
    try {
      input match {
        case x: Boolean    ⇒ if (x) 1 else 0
        case x: Int        ⇒ x.toDouble
        case x: Integer    ⇒ x.toDouble
        case x: Long       ⇒ x.toDouble
        case x: BigDecimal ⇒ x.toDouble
        case x: Double     ⇒ x
        case x: Float      ⇒ x.toDouble
        case "null" ⇒ Double.MinValue
        case x: String ⇒ x.toDouble
        case x @ _ ⇒ x.toString.toDouble
      }
    } catch {
      case _: Throwable ⇒ Double.MinValue
    }
  }
